#include <freepoi/amf/codec.h>
#include "test.h"

const uint8_t s1[] = { 0x02, 0x00, 0x04, 'Y', 'E', 'A', 'H' };

const char lstr[] = "\x0C\x00\x01\x00\x60"
                    "";

uint8_t buf[0xFFFFFF] = { };

int
main(void)
{
    void *p;
    print_test_message("Checking if zero-length sources are rejected");
    p = freepoi_amf_encode_string(buf, 42, "", 0);
    is_equal(p, buf + 3);
    print_test_message("Checking if the returned offset is correct");
    p = freepoi_amf_encode_string(buf, 42, "YEAH", 4);
    is_equal(p, buf + 4 + 3);
    print_test_message("Checking if the encoded string is correct");
    memcmp_test(buf, s1, sizeof(s1));
    print_test_message("Checking if sources larger than destination size are rejected");
    p = freepoi_amf_encode_string(buf, 4, "YEAH", 40);
    is_equal(p, NULL);
    print_test_message("Checking if the offset returned for long strings are correct");
    p = freepoi_amf_encode_string(buf, sizeof(buf), lstr + 5, 65632);
    is_equal(p, buf + 5 + 65632);
    print_test_message("Checking if the encoded long string is correct");
    memcmp_test(buf, lstr, 65632 + 5);
    return ALL_CLEAR;
}
